function getCreatedRecordsByMonth(dataset) {
  const recordsByMonth = {};

  for (let i = 1; i <= 12; i++) {
    recordsByMonth[moment().month(i - 1).format('MMM')] = 0;
  }

  dataset.forEach(record => {
    const month = moment(record.created_at).format('MMM');
    recordsByMonth[month] += 1;
  });

  const result = Object.keys(recordsByMonth).map(month => ({
    x: month,
    y: recordsByMonth[month]
  }));

  return result;
}

const graphData = getCreatedRecordsByMonth(data);
return graphData;

